.line-behind {
  position: relative;

  span {
    &.headline-span-wrapper {
      display: block;
      width: 100%;
      position: relative;

      &::before {
        content: "";
        position: absolute;
        width: 100%;
        z-index: 0;
        height: 2px;
        background-color: bg-color("bg-lighter");
        left: 0;
        top: calc(50% - 1px);
      }
    }

    &.headline-span {
      padding-left: 1rem;
      padding-right: 1rem;
      background-color: #fff;
      z-index: 1;
      position: relative;
    }
  }

  &.headline-grid {
    span {
      &.headline-span {
        padding-left: 0;
      }
    }
  }
}

